  const [isModalOpen, setIsModalOpen] = useState(false);
  const [open, setOpen] = useState(false);
  const showModal = () => {
    setIsModalOpen(true);
  };
  const handleOk = () => {
    setIsModalOpen(false);
  };
  const handleCancel = () => {
    setIsModalOpen(false);
  };
  return (
    <>
      <Button type="primary" onClick={() => setModal1Open(true)}>
      阅读「用户协议」和「隐私条款」
      </Button>
      <Modal title="「用户协议」和「隐私条款」"
        centered
        style={{ top: 20 }}
        open={modal1Open}
        onOk={() => setModal1Open(false)}
        onCancel={() => setModal1Open(false)}
        width={1000}
        >
        <p>用户协议</p>
        <p>尊敬的用户，欢迎使用由TBD stdio提供的服务（以下简称TBD）。在使用前请您阅读如下服务协议，使用本应用即表示您同意接受本协议，本协议产生法律效力，特别涉及免除或者限制中其责任的条款，请仔细阅读。如有任何问题，可向中其信息咨询。</p>
        <p>1. 服务条款的确认和接受</p>
        <p>通过访问或使用本应用，表示用户同意接受本协议的所有条件和条款。</p>
        <p>2. 服务条款的变更和修改</p>
        <p>TBD有权在必要时修改服务条款，服务条款一旦发生变更，将会在重要页面上提示修改内容。如果不同意所改动的内容，用户可以放弃获得的本应用信息服务。如果用户继续享用本应用的信息服务，则视为接受服务条款的变更。本应用保留随时修改或中断服务而不需要通知用户的权利。本应用行使修改或中断服务的权利，不需对用户或第三方负责。</p>
        <p>3. 用户行为</p>
        <p>3.1 用户账号、密码和安全</p>
        <p>您需要注册登录账号才可使用我司产品功能。</p>
        <p>3.2 账号注册时的禁止行为</p>
        <p>（1）请勿以党和国家领导人或其他社会名人的真实姓名、字号、艺名、笔名注册；</p>
        <p>（2）冒充任何人或机构，或以虚伪不实的方式谎称或使人误认为与任何人或任何机构有关的名称；</p>
        <p>（3）请勿注册和其他网友之名相近、相仿的名字；</p>
        <p>（4）请勿注册不文明、不健康名字，或包含歧视、侮辱、猥亵类词语的名字；</p>
        <p>（5）请勿注册易产生歧义、引起他人误解的名字；</p>
        <p>3.3 用户在本应用上不得发布下列违法信息和照片：</p>
        <p>（1）反对宪法所确定的基本原则的；</p>
        <p>（2）危害国家安全，泄露国家秘密，颠覆国家政权，破坏国家统一的；</p>
        <p>（3）损害国家荣誉和利益的；</p>
        <p>（4）煽动民族仇恨、民族歧视，破坏民族团结的；</p>
        <p>（5）破坏国家宗教政策，宣扬邪教和封建迷信的；</p>
        <p>（6）散布谣言，扰乱社会秩序，破坏社会稳定的；</p>
        <p>（7）散布淫秽、色情、赌博、暴力、凶杀、恐怖或者教唆犯罪的；</p>
        <p>（8）侮辱或者诽谤他人，侵害他人合法权益的；</p>
        <p>（9）含有法律、行政法规禁止的其他内容的；</p>
        <p>（10）禁止骚扰、毁谤、威胁、仿冒网站其他用户；</p>
        <p>（11）严禁煽动非法集会、结社、游行、示威、聚众扰乱社会秩序；</p>
        <p>（12）严禁发布可能会妨害第三方权益的文件或者信息，例如（包括但不限于）：病毒代码、黑客程序、软件破解注册信息。</p>
        <p>（13）禁止上传他人作品。其中包括你从互联网上下载、截图或收集的他人的作品；</p>
        <p>（14）禁止上传广告、横幅、标志等网络图片；</p>
        <p>4. 服务内容</p>
        <p>本服务的具体内容由TBD根据实际情况提供，TBD可以对其提供的服务予以变更，且TBD提供的服务内容可能随时变更。该软件属于免费应用，用户使用过程中，本软件不会以任何方式、名义收取任何费用。</p>
        <p>隐私条款</p>
        <p>1.用户信息公开情况说明</p>
        <p>尊重用户个人隐私是中其信息的一项基本政策。所以，TBD不会在未经合法用户授权时公开、编辑或透露其注册资料及保存在本应用中的非公开内容，除非有下列情况：
</p>
        <p>（1）有关法律规定或TBD合法服务程序规定；</p>
        <p>（2）在紧急情况下，为维护用户及公众的权益；</p>
        <p>（3）为维护TBD的商标权、专利权及其他任何合法权益；</p>
        <p>（4）其他需要公开、编辑或透露个人信息的情况；</p>
        <p>在以下（包括但不限于）几种情况下，TBD有权使用用户的个人信息：</p>
        <p>（1）在进行促销或抽奖时，TBD可能会与赞助商共享用户的个人信息，在这些情况下TBD会在发送用户信息之前进行提示，并且用户可以通过不参与来终止传送过程；</p>
        <p>（2）TBD可以将用户信息与第三方数据匹配；</p>
        <p>（3）TBD会通过透露合计用户统计数据，向未来的合作伙伴、广告商及其他第三方以及为了其他合法目的而描述中其信息的服务；</p>
        <p>2.隐私权政策适用范围</p>
        <p>（1）用户在使用本应用服务器时留下的个人身份信息；</p>
        <p>（2）用户通过本应用服务器与其他用户或非用户之间传送的各种资讯；</p>
        <p>（3）本应用与商业伙伴共享的其他用户或非用户的各种信息；</p>
        <p>（4）TBD软件十分注重保护用户的个人隐私，并制定了《隐私政策》，用户亦可以通过《隐私政策》，用户确认并同意使用中其信息软件提供的服务将被视为接受《隐私政策》。
</p>
        <p>3.资讯公开与共享</p>
        <p>TBD不会将用户的个人信息和资讯故意透露、出租或出售给任何第三方。但以下情况除外：</p>
        <p>（1）用户本人同意与第三方共享信息和资讯;</p>
        <p>（2）只有透露用户的个人信息和资讯，才能提供用户所要求的某种产品和服务;</p>
        <p>（3）应代表本应用提供产品或服务的主体的要求提供（除非我们另行通知，否则该等主体无权将相关用户个人信息和资讯用于提供产品和服务之外的其他用途）：根据法律法规或行政命令的要求提供;因外部审计需要而提供;用户违反了本应用服务条款或任何其他产品及服务的使用规定;经本站评估，用户的帐户存在风险，需要加以保护。</p>
        <p>4.非个人隐私信息</p>
        <p>为了改善TBD软件的技术和服务，向用户提供更好的服务体验，TBD或可会自行收集使用或向第三方提供用户的非个人隐私信息。
</p>
        <p></p>





      </Modal>
    </>
  );
};



export default Feiju
